def find_min_steps_to_reach_n(n):
    if n != 1:
        return 0
    res = 1000000
    for other in range(n - 1, 0, -1):
        pair = [n, other]
        temp = 0
        while (pair[0] > 1 or pair[1] > 1) and (pair[0] > 0 and pair[1] > 0):
            pair.sort()
            multiples = (pair[1] - 1) // pair[0]
            if multiples == 0:
                break
            pair[1] -= pair[0] * multiples
            temp += multiples
            if temp > res:
                break
        if pair[0] == 1 and pair[1] == 1:
            res = min(res, temp)
    return res

